import "./cliente.css";
function Cliente(props) {

    let exibirTexto = false

    function Exibir() {
        exibirTexto = true
    }

    return     <div>
    
    <b>{props.nome}</b> {
        props.categoria == "premium" ? <img className="estrela" src="https://uxwing.com/wp-content/themes/uxwing/download/arts-graphic-shapes/star-icon.png"/>
        : <span>--</span>
    } <br/>
    {props.cidade} - {props.uf} <br />
    <button className="btnMaisDetalhes" onClick={Exibir}>Mais Detalhes</button>
    <p>Lorem ipsum dolor, sit amet consectetur adipisicing elit. Assumenda accusantium totam eum ad culpa molestiae alias, facere mollitia maxime voluptas, in, amet delectus asperiores vero esse velit? Nihil, necessitatibus illo.</p>
    <hr/>
  </div>
}

export default Cliente
